public function setResultSetPrototype(\Zhorty\Entity\Trim $entity) {    if (!$this->entityHydrator) {        throw new \Exception('Hydrator for entity is not set');    }    $this->entity = $entity;    $this->resultSetPrototype = new HydratingResultSet(        $this->entityHydrator,        $entity	 );}public function fetchAll(){    $resultSet = $this->select();    return $resultSet;}